    head: "Cash Management Services(CMS)",
    subHead: "Efficient cash handling solutions for modern businesses",
    para1:
      "At Webwise Studio, we enable our retail partners to offer affordable and accessible insurance services to customers across urban and rural India. Our platform brings a range of insurance products—life, health, personal accident, and micro-insurance—right to the local retail store, eliminating the barriers of paperwork, awareness, and access.",
    para2:
      "Our CMS network helps bridge the last-mile gap by enabling real-time cash deposits into designated accounts using our platform. These services are especially beneficial for NBFCs, delivery companies, microfinance institutions, and logistics providers who operate in cash-heavy environments and require frequent, decentralized deposit points. Through our system, every transaction is tracked, secure, and digitally verified, giving businesses complete transparency and control over their cash flow. ",
    para3:
      "With Webwise Studio, businesses not only reduce operational overhead and the risks associated with physical cash handling, but also improve turnaround times for collections and settlements. Our CMS platform ensures that funds are credited quickly, efficiently, and with minimal friction—empowering field agents and improving business performance at scale.",
